CREATE TABLE enrolls_in (
  students_id int NOT NULL,
  courses_CourseID varchar(9) NOT NULL,
  Grade decimal(10,0) DEFAULT NULL,
  Semester varchar(7)  NOT NULL,
  `Year` varchar(4)  NOT NULL,
  PRIMARY KEY (students_id, courses_CourseID, `Year`, Semester),
  KEY fk_students_courses_course (courses_CourseID),
  CONSTRAINT fk_students_courses_course FOREIGN KEY (courses_CourseID) REFERENCES courses (CourseID),
  CONSTRAINT fk_students_courses_student FOREIGN KEY (students_id) REFERENCES students (id)
) ;

